import './Contacts.css';

const Contacts = () => {
    return (
        <div className='Contacts'>
            <h4>Headquarters address</h4>
            <h3>Phone:</h3>
            <a href='tel:1 (800) 446 92 40'>1 (800) 446 92 40</a>

            <h4>Store address:</h4>
            <div>201 Fifth Ave</div>
            <div>Williamsburg, VA 23185</div>
        </div>
    )
}

export default Contacts;
